import { ArrowBackIosOutlined } from "@material-ui/icons";
import "./main.css";

const Main = () => {
    return (
        <div className="main">
            <div className="main__wrapper">
                <div className="main__top">
                    <span className="main__top-text">Tất cả</span>
                    <span className="main__top-text">Danh sách kết hợp</span>
                    <span className="main__top-text">Âm nhạc</span>
                    <span className="main__top-text">Toán học</span>
                    <span className="main__top-text">Hài kịch tình huống</span>
                    <span className="main__top-text">Hoạt hình</span>
                    <span className="main__top-text">Chương trình nấu ăn</span>
                    <span className="main__top-text">Trực tiếp</span>
                    <span className="main__top-text">Bóng đá</span>
                    <span className="main__top-text">Đọc rap</span>
                    <span className="main__top-text">Trò chơi</span>
                    <ArrowIosOutlined />
                </div>
            </div>
        </div>
    );
};

export default Main;
